J.heredoc = function(fn){return (fn.toString().split('\n').slice(1,-1).join('\n') + '\n');};
J.log = function(obj){(window['console']||{log:function(x){alert(x);}}).log(obj);};
J.toHtml = function(tpl,obj,ext){tpl = Hogan.compile(tpl);return (tpl.render(obj,ext));};
J.$win = $(window);
J.$body=$('body');
J.toEntities = function(tstr){
    var bstr = '';
    for(i=0; i<tstr.length; i++)
    {
        if(tstr.charCodeAt(i)>127)
        {
            bstr += '&#' + tstr.charCodeAt(i) + ';';
        }else{
            bstr += tstr.charAt(i);
        };
    };
    return bstr;
};
J.textToHex=function (str) {
      //escape对0-255以外的unicode值进行编码时输出%u****格式，例如：%u6267%u624b%u6cea%u773c
      //将其中的%替换成\就是十六进制的
    var rStr = '',
        len = str.length;
    for(var i=0;i<len;i++){
        if(str.charCodeAt(i)>255){
            rStr+=escape(str.charAt(i)).replace(/%/g,'\\');
        }else{
            rStr+=str.charAt(i);
        }
    };
    return rStr;
};
//http://www.sitepoint.com/javascript-generate-lighter-darker-color/
J.colorLighten=function(hex, lum) {
    // validate hex string
    hex = String(hex).replace(/[^0-9a-f]/gi, '');
    if (hex.length < 6) {
        hex = hex[0]+hex[0]+hex[1]+hex[1]+hex[2]+hex[2];
    };
    lum = lum || 0;

    // convert to decimal and change luminosity
    var rgb = "#", c, i;
    for (i = 0; i < 3; i++) {
        c = parseInt(hex.substr(i*2,2), 16);
        c = Math.round(Math.min(Math.max(0, c + (c * lum)), 255)).toString(16);
        rgb += ("00"+c).substr(c.length);
    };
    return rgb;
};
/*
 * format number to a more readable format
 * @author feeling
 */
J.formatNum=function(strNum){
    var newNum=strNum.split("").reverse().join("");
    var newStr="";
    var returnStr="";
    for(var i=0; i<newNum.length; i+=3){
        newStr += newNum.substr(i,3).split("").reverse().join("") + ",";
    }

    returnStr=newStr.split(",").reverse().splice(1).join(",");
    return returnStr;
};
